ols_results = ols_model.fit()

# Extract the feature names from the preprocessor
categorical_transformer = preprocessor.transformers_[0][1]
categorical_feature_names = categorical_transformer.get_feature_names_out(input_features=categorical_cols)

# Combine the categorical feature names with the numerical feature names
feature_names = list(categorical_feature_names) + numerical_cols

# Create a DataFrame to store the coefficients and p-values
coefficients = pd.DataFrame({'Feature': feature_names, 'Coefficient': ols_results.params, 'P-value': ols_results.pvalues})

# Print the coefficients and their significance (p-values)
print(coefficients)

# Print the summary of OLS results
print(ols_results.summary())

